package com.example.jetpackcomposeassignment.feature_listcat.data.modelimport com.google.gson.annotations.SerializedNamedata class CatDetail(    @SerializedName("_id") val id: String,    @SerializedName("tags") val tags: List<String>?,    @SerializedName("mimetype") val mimetype: String?,    @SerializedName("name") val name: String,    @SerializedName("temperament") val temperament: List<String>,    @SerializedName("origin") val origin: String,    @SerializedName("date") val date: String,    @SerializedName("description") val description: String,    @SerializedName("child_friendly") val childFriendly: Boolean,    @SerializedName("energy_level") val energyLevel: Int,    @SerializedName("dog_friendly") val dogFriendly: Boolean,    @SerializedName("stranger_friendly") val strangerFriendly: Boolean,    @SerializedName("acceptLap") val acceptLap: Boolean,    @SerializedName("indoor") val indoor: Boolean,)